import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
    <Router>
   <div>
     <Routes>
     <Route path="/"  />
     <Route path="/success"  />

     </Routes>
   </div>
 </Router>
 </div>
  );
}

export default App;
